import React from 'react';
import styled, { keyframes } from 'styled-components';
import Nav from '../Nav/Nav';


const Home = () => {
    return (
        <Page>
            <Nav home={true}/>
            <Landing>
                <Logo className="logo">HUE STAGE</Logo>
            </Landing>
            <Animations>
                <Orb1/>
                <Orb2/>
            </Animations>
        </Page>
    );
};

export default Home;

let Landing = styled.div`
    color: white;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: rgba(0,0,0,0);
`

let Page = styled.div`
    background-color: rgba(0,0,0,0);
`

let logoAnimation = keyframes`
    0% {
        padding-top: 450px;
        opacity: 0%;
    }
    30% {
        opacity: 30%;
    }
    90% {
        padding-top: 450px;
    }
    100% {
        padding-top: 350px;
    }
`

let Logo = styled.h2`
    padding-top: 350px;
    font-size: 4rem;
    letter-spacing: 0.8rem;
    z-index: 2;
    background-color: rgba(0,0,0,0);
    animation-name: ${logoAnimation};
    animation-duration: 2s;
    animation-iteration-count: 1;
`

let Animations = styled.div`
    position: fixed;
    width: 100vw;
    height: 100vh;
    z-index: 1;

`

let orb1Animation = keyframes`
    0% {
        width: 0px;
        height: 0px;
        left: 800px;
        box-shadow: none;
    }

    50% {
        width: 0.5px;
        height: 0.5px;
        box-shadow: 0 0 1500px 400px deeppink;
    }

    100% {
        left: 0px;
        box-shadow: none;

    }
`

let orb2Animation = keyframes`
    0% {
        width: 0px;
        height: 0px;
        right: 800px;
        box-shadow: none;
    }

    50% {
        width: 0.5px;
        height: 0.5px;
        box-shadow: 0 0 1500px 400px cyan;
    }

    100% {
        right: 0px;
        box-shadow: none;
    }
`

let Orb1 = styled.div`
    position: absolute;
    border-radius: 50%;
    overflow: hidden;
    animation-name: ${orb1Animation};
    animation-duration: 3s;
    animation-iteration-count: 1;
`

let Orb2 = styled.div`
    position: absolute;
    border-radius: 50%;
    right: 0px;
    overflow: hidden;
    animation-name: ${orb2Animation};
    animation-duration: 3s;
    animation-iteration-count: 1;
`



